import React,{useEffect} from 'react'
import Header from './components/Layout/Header'
import Meals from './components/Meals/Meals'
import Cart from './components/Cart/Cart'

function App() {
  useEffect(() => {
    document.title = "Food App.";
  }, []);

  return (
    <React.Fragment>
      <Cart/>
      <Header />
      <Meals/>
    </React.Fragment>
  );
}

export default App;
